Mô tả:
Lenovo Yoga 310 sở hữu màn hình chỉ 11 inch cảm ứng, xoay 360 độ cùng trọng lượng siêu nhẹ linh động tối đa, phù hợp nhu cầu văn phòng cần sự tiện lợi.
<h3><strong>Trọng lượng siêu nhẹ, linh động tuyệt đối</strong></h3>
&nbsp;

<img class="aligncenter" title="Lenovo Yoga 310 " src="https://fptshop.com.vn/Uploads/images/2015/MinhtriBin7/lenovo-yoga-310-11iap-06.jpg" alt="Lenovo Yoga 310 " longdesc="https://fptshop.com.vn/may-tinh-xach-tay/Lenovo%20Yoga%20310" />

&nbsp;

“Mang đi bất cứ nơi đâu, sử dụng bất cứ khi nào”. Lenovo Yoga 310 11iap thiết kế dựa trên nền tảng tối đa tính linh động, tối ưu việc kết nối, cùng xu hướng công nghệ với màn hình xoay 360 độ. Bên cạnh đó, Yoga 310 chỉ nặng 1.35 Kg và dày chỉ 20.9 mm, bạn sẽ rất thoải mái cho máy vào balo, túi xách phù hợp với những bạn có cuộc sống năng động hay di chuyển nhiều.
<h3><strong>Bộ nhớ khủng, lưu trữ hàng ngàn dữ liệu</strong></h3>
&nbsp;

<img class="aligncenter" title="Lenovo Yoga 310 " src="https://fptshop.com.vn/Uploads/images/2015/MinhtriBin7/lenovo-yoga-310-11iap-02.jpg" alt="Lenovo Yoga 310 " longdesc="https://fptshop.com.vn/may-tinh-xach-tay/Lenovo%20Yoga%20310" />

&nbsp;

Tất cả các ứng dụng, video, hình ảnh yêu thích của bạn sẽ được lưu trữ dễ dàng với bộ nhớ lên đến 64 Gb và hỗ trợ khe cấm thẻ SD, có cảm giác cả kho giải trí đang nằm gọn trong lòng bàn tay của bạn với Lenovo Yoga.
